import React, { useEffect } from "react";
import { useSelector } from "react-redux";

const Chats = () => {
  const token = localStorage.getItem("token");
  const store = useSelector((data) => data);
  console.log(store.userReducer.friends);

  async function setFriendMessage(id) {
    const resp = await fetch(
      `https://telegram-alisherjon-api.herokuapp.com/chats/${id}`,
      {
        headers: {
          "Content-Type": "application/json",
          authorization: `Bearer ${token}`,
        },
        method: "GET",
      }
    );

    const respData = await resp.json();
    console.log(respData);
    return respData.chat.messages;
  }
  return <div className="chat-members">bu ChatMembers page</div>;
};

export default Chats;
